import org.junit.jupiter.api.Assertions.*
import org.junit.jupiter.api.Test

internal class RemoveAdjascentLettersTest {
    @Test
    fun removeDuplicatesTest() {
        assertEquals(
            "abcd",
            RemoveAdjascentLetters.removeDuplicatesStack("abcd", 2)
        )

        assertEquals(
            "aa",
            RemoveAdjascentLetters.removeDuplicatesStack("deeedbbcccbdaa", 3)
        )

        assertEquals(
            "",
            RemoveAdjascentLetters.removeDuplicatesStack("", 2)
        )
    }
}
